import classes from './ArchiveSection.module.css';
import Container from './MainContent/Container';

const ArchiveSection = () => {
  return(
    <div id='Archive' className={classes.Archive}>
      <Container>
        <h2 className={classes.ArchiveHeader}>Задания регионального этапа Всероссийской олимпиады школьников по физике</h2>
      </Container>
    </div>
  ) 
}

export default ArchiveSection;
